import React from 'react';


const Home = () => {
  const logoutHandler = () => {
    localStorage.token = ''
    navigate('/login')
  }
  return (
    <div>
      <button onClick={logoutHandler}>Выйти из чата</button>
    </div>
  );
};



export default Home;
